import { Button, BaseControl } from "@wordpress/components";
import { withComponentBlock } from "/lib/block-utils";

export const block = {
  apiVersion: 2,
  title: "Button",
  icon: "smiley",
  category: "components",
  attributes: {
    variant: {
      type: "string",
      enum: ["primary", "secondary", "tertiary"],
      control: {
        options: {
          "(none)": null,
          Primary: "primary",
          Secondary: "secondary",
          Tertiary: "tertiary"
        }
      }
    }
  }
};

export const Edit = withComponentBlock(Button, block);

export default {
  ...block,
  edit: Edit
};
